import SignUp from './SignUp';
import SignIn from './SignIn';
import Profile from './Profile';

const routes = {
    unauthenticated: [
        {
            path: '/auth/signin',
            content: 'Sign In',
            component: SignIn
        },
        {
            path: '/auth/signup',
            content: 'Sign Up',
            component: SignUp
        }],
    authenticated: [
        {
            path: '/auth/profile',
            content: 'Profile',
            coomponent: Profile
        },
        {
            path: '/auth/logout',
            content: 'Logout',
            component: <div>Nothing</div>
        }]
}

export default routes;
